import geopandas as gpd
import json
import folium
from folium.plugins import Draw, MousePosition, HeatMap
from custom_template import _template
import pandas as pd

i = -1

def visualize_polygons(geometry):
    lats, lons = get_lat_lon(geometry)

    m = folium.Map(location=[sum(lats) / len(lats), sum(lons) / len(lons)], zoom_start=13, tiles='OpenStreetMap',
                   control_scale=True)
    overlay = gpd.GeoSeries(geometry).to_json()
    folium.GeoJson(overlay,
                   style_function=lambda x: {
                       "fillColor": getcolor(),
                       "color": "white",
                       "fillOpacity": 0.3
                   }
                   , name='Границы Москвы').add_to(m)

    return m


def getcolor():
    global i
    colors = ["gold", "red", "navy", "plum", "lightcoral", "gray", "cyan", "lightblue", "seagreen", "black", "gold"]
    i += 1
    return colors[1]


# выводим центроиды полигонов
def get_lat_lon(geometry):
    lon = geometry.apply(lambda x: x.x if x.type == 'Point' else x.centroid.x)
    lat = geometry.apply(lambda x: x.y if x.type == 'Point' else x.centroid.y)
    return lat, lon


